import js from "./svg/js.svg";
import react from "./svg/react.svg";
import sql from "./svg/sql.svg";
import html from "./svg/html.svg";


export const techs = [
  { name: "JavaScript", image: js },
  { name: "React", image: react },
  { name: "SQL", image: sql },
  { name: "HTML", image: html},
]
